measurements.description:
Two slightly cupped, very full flowers on two inflorescences of 28 cm. and 31 cm. lengths;
	dorsal sepal white, veined with dark green; synsepal white, veined with lime green;
	petals light chartreuse, veined with dark green, much darker green centrally, heavily warted and hirsute;
	pouch chartreuse; staminode chartreuse with two dark green spots; substance heavy; texture glossy.
